COPY public.drill_question (id, q, a, topic_id) FROM stdin;
1	<p>Name 4 unstable severe conditions in which we do not do ABC first.</p>	<ul>\r\n<li>V. fib and V. fib equivalent</li>\r\n<li>Unstable pneumothorax</li>\r\n<li>Pericardium tamponade</li>\r\n<li>Anaphylactic shock</li>\r\n</ul>	1
3	<p>Name the treatment for unstable pneumothorax.</p>	<p>Needle decompression/chest tube</p>	1
2	<p>Name the treatment for severely unstable V. fib and V. fib equivalent.</p>	<p>ACLS, BLS (CAB)</p>	1
4	<p>Name the treatment for pericardium tamponade.</p>	<p>Pericardiocentesis</p>	1
5	<p>Name the treatment for anaphylactic shock.</p>	<p>Epinephrine pen/IM</p>	1
6	<p>What is the treatment for pulselessness electrical activity?</p>	<p>Chest compression</p>	1
7	<p>Name three absolute contraindications for orotracheal intubation.</p>	<ol>\r\n<li>Facial or facial bone severe injury</li>\r\n<li>Cannot visualize glottis</li>\r\n<li>Severe pharyngeal or laryngeal injury</li>\r\n</ol>	1
8	<p>What are the relative contraindications of orotracheal intubation?</p>	<ul>\r\n<li>C1-C2 instability (or Axial-Atlanto instability)</li>\r\n<li>Any cervical injury </li>\r\n<li>Note: It is okay to have orotracheal intubatation when C-collar is in place</li>\r\n</ul>	1
9	<p>What are two medical histories that can cause axial-atlanto instability?</p>	<ol>\r\n<li>Down&rsquo;s</li>\r\n<li>Rheumatoid Arthritis</li>\r\n</ol>	1
10	<p>When do we use CAB in an emergency department?</p>	<ul>\r\n<li>Any cardiac arrest without ACLS available</li>\r\n<li>PEA</li>\r\n<li>No pulse without ACLS available</li>\r\n</ul>	1
13	<p>What are the five points of high-quality CPR?</p>	<ol>\r\n<li>Rate at least 100/min, not more than 120/min</li>\r\n<li>Compression depth at least 2 inches (5 cm) but no more than 2.5 in (6 cm)</li>\r\n<li>Allow complete chest recoil after each compression</li>\r\n<li>Minimize interruption in chest compression</li>\r\n<li>Avoid excessive ventilation</li>\r\n</ol>	1
14	<p>What is the best way to assess circulation?</p>	<p>Palpate for pulse</p>	1
19	<p>What is most common complication of intraosseous access?</p>	<p>Infection</p>	1
20	<p>What is the maximum number of hours that intraosseous access can be used?</p>	<p>&lt; 24 hours</p>	1
