COPY public.qbank_question (id, vignette, explanation_summary, correct_answer_id) FROM stdin;
5	In a small town of 55,000 people, 1200 people was selected to study the incidence Diabetic Mellitus type 2. There are 500 people have Diabetic Mellitus type 2 while 700 people do not have disease. Test A which has sensitivity of 80% and specificity of 90% is used to diagnose DM.  It has the confidence interval of 1.4-1.5, p is 0.02, and SD of 10.  Assumption this study has the bell curve distribution with mean, mode, and median of s.Glucose 130. According to this statistic, if a person has a positive test A result, what is the possibility that he or she has DM?	The author asked for the positive predictive value.  PPV= TP/ all positive tests = TP/ (TP+FP) \r\nTP= sensitivity x all people with disease = 0.80 x 500 =400.\r\nFP = all people without disease - TN.  Specificity = TN / all people without disease.  Therefore, TN = 0.90 x 700 = 630.  FP = 700 - 630 =70\r\nPPV = 400 / (400 +70) = 0.85 or 85 %	6
