COPY public.staff_independentcontractorterms (id, document, date) FROM stdin;
1	<p>I understand that I am an independent contractor to Ocean Ink LLC (&ldquo;the Company&rdquo;), and am not an employee of the Company.</p>\r\n<p>I agree that I have entered into this independent contractor relationship with the Company voluntarily and the Company, and I have agreed to review this relationship at the end of every calendar month. The Company may terminate the use of my services if my performance of duties is deemed to be ineffective, inappropriate or insufficient. I may also terminate working for the Company for any reason having supplied two weeks' notice.</p>\r\n<p><strong>Contractor:</strong></p>\r\n<p>The Company will utilize me, as needed by the Company, for the following purposes: drilling and/or tutoring of Company clients. I agree <!-- not to accept or solicit (directly or indirectly) business from any past, present or future company client or member of client's family, and agrees--> not to use in any way the Company's present or future name, mark, website or other identifying information for any purposes whatsoever (except on behalf of the Company)<!--, including but not limited to any sort of self-promotion or business not directly associated with the Company's business. Contractor may however work for other tutoring companies, or tutor for private clients, so long as these clients have zero association with the Company-->. I agree that any information I generate for the Company and all information that the Company provides me is considered copyrighted material for the Company and that I cannot use such information without specific authorization from Company management, including in uses outside of the Company's services.</p>\r\n<p><strong>Duties:</strong></p>\r\n<p>I am required to follow these duties:</p>\r\n<ul>\r\n<li>Check my registered email account on a regular basis.</li>\r\n<li>Begin session(s) on time and fully prepared.</li>\r\n<li>Stay in touch with Company Staff, making sure to return any phone or email messages promptly.</li>\r\n<li>Continually update my profile on Company website.</li>\r\n<li>Report any corrections needed on Company materials.</li>\r\n<li>Report the times of services to the Company as outlined in the informational email.</li>\r\n</ul>\r\n<p><strong>Compensation:</strong></p>\r\n<p>I understand that the Company compensates its independent contractors as set forth in the informational email received at the time of assignment.</p>\r\n<p>I understand that in order to receive payment, I must:</p>\r\n<ul>\r\n<li>Complete a W-9 form if a US citizen and return it to the Company.</li>\r\n<li>Sign this Agreement.</li>\r\n<li>Follow duties listed above.</li>\r\n</ul>\r\n<p><strong>Other:</strong></p>\r\n<p>The Company reserves the right, at its sole discretion, to change or modify any of the terms and conditions applicable to my affiliation with the Company. Such changes, modifications, additions or deletions shall be effective immediately upon notice thereof, which may be given by means including, but not limited to, email or posting on a Company website. I understand that these changes will be binding on me unless I promptly notify the Company that I do not agree to the changes and am therefore terminating this Agreement.</p>\r\n<p>Specific Restrictions. I agree</p>\r\n<ol>\r\n<li>to abide by all applicable local, state, national, and international laws and regulations in my use of the Company&rsquo;s websites and participation in the the Company's services;</li>\r\n<li>to not interfere with any other contractor's or student&rsquo;s use and enjoyment of the Company&rsquo;s websites or programs;</li>\r\n<li>to be solely responsible for the contents of my transmissions through the Company's services;</li>\r\n<li>to not interfere with or disrupt the Company&rsquo;s websites, servers, networks, or third party accounts connected to the Company&rsquo;s services;</li>\r\n<li>to comply with all requirements, procedures, policies and regulations posted on the Company&rsquo;s websites by the Company from time to time and or any networks connected to the Company&rsquo;s websites and/or third party websites utilized by the Company, including Zoom;</li>\r\n<li>that my entering into this Agreement and delivering services to the Company&rsquo;s customers and end users does not and shall not breach any agreement with any third party;</li>\r\n<li>to transmit a professional demeanor, including the use of professional attire while hosting the Company's services;</li>\r\n<li>to not transmit any material that violates the rights (including intellectual property rights) of another;</li>\r\n<li>to not transmit any material that violates any applicable local, state, national, or international law or regulation including, without limitation, any U.S. export law or regulation;</li>\r\n<li>to not promote any other products or services to students or learners without specific authorization provided in advance by an authorized member of Company management;</li>\r\n<li>to not schedule or conduct other drilling or tutoring sessions during any hours I am scheduled for the Company's services; and</li>\r\n<li>to keep my username and password confidential at all times and ensure that no other person ever provides or attempts to provide services using my login credentials.</li>\r\n</ol>\r\n<p>Confidential Information. I agree to hold in confidence and keep confidential any and all confidential information that I receive from the Company, company&rsquo;s customers, and prospective customers. I agree to not disclose any such information to any third party (including other independent contractors) and agree to not use such information for any purpose except to assist the drilling or tutoring session. I agree to compensate the Company for losses it incurs as a result of my negligent, reckless, or intentional disclosure of Confidential Information. Confidential information in this context includes, but is not limited to, any information, idea or concept, in any form (tangible or intangible), whether disclosed to me or learned by me. For the purpose of this Agreement, confidential information specifically includes:</p>\r\n<ul>\r\n<li>all information concerning students, patrons, learners, employees, and other independent contractors, including but not limited to information concerning their age, sex, sexual orientation, religious affiliation, ethnicity, national origin, ancestry, disability, or other personally identifiable information;</li>\r\n</ul>\r\n<ul>\r\n<li>all information of a competitively sensitive nature, including trade secrets or confidential or proprietary information of any sort, including, without limitation, information relating to products, processes, know-how, designs, formulas, developmental or experimental work, computer programs, databases, or other original works of authorship, customer lists, business plans, financial information or other subject matter pertaining to any business of the Company or any persons or entities with which it does business; and all information concerning Company policies, strategies, finances, pricing, pay rates, use of independent contractors, and the nature of relationships between corporate management and its service providers, customers, and end users - including the specific questions such users ask while using the Company&rsquo;s services.</li>\r\n</ul>\r\n<p>I affirm that I have provided true, accurate, current, and complete information on my application form, along with an accurate representation of my skills, degrees, background and other information, and I agree to maintain and update such information to keep it true, accurate, current, and complete for as long as I continue to be affiliated with the Company.</p>\r\n<p>This Agreement will become effective as of the date of the Company&rsquo;s acceptance of Contractor's application. Terms of payment are addressed in a separate document. The Company has the right to suspend service to any Contractor for any reason without warning. Furthermore, The Company may terminate this Agreement immediately (with or without warning) for any breach by Contractor of this Agreement or any applicable policy of The Company posted on the Site, or for no reason at all.</p>\r\n<p>I agree to be bound by the terms of this Agreement effective immediately, regardless of whether the Company accepts my application or offers me opportunities, and agree that in the event that either I or the Company terminate this independent contractor relationship, the following provisions will survive indefinitely. By signing below, I affirm that I have read and understand this entire Agreement and agree to be subject to all of its terms and conditions.</p>	2021-01-19
